description:
Le présent fichier propose en open data les données budgétaires relatives au premier « budget vert » annexé au projet de loi de finances 2021. 
Le rapport sur l’impact environnemental du budget de l’État est institué par la loi n°2019-1479 du 28 décembre 2019 de finances pour 2020, qui prévoit que le Gouvernement remet au Parlement, en annexe au projet de loi de finances (PLF), un rapport sur « l'impact environnemental du budget de l’État ». La première partie du rapport, communément appelée « budget vert », présente pour la première fois une cotation de l’impact environnemental de l’ensemble des crédits budgétaires, des taxes affectées plafonnées et des dépenses fiscales. 
Le présent fichier expose, pour chacune de ces composantes du budget de l’État présentées dans les programmes annuels de performance, la cotation retenue selon six axes environnementaux :
\- la lutte contre le changement climatique : axe « atténuation climat » ;  
\- l’adaptation au changement climatique et la prévention des risques naturels : axe « adaptation climat » ;
\- la gestion de la ressource en eau : axe « eau » ;
\- l’économie circulaire, les déchets ; la prévention des risques technologiques : axe « déchets » ;
\- la lutte contre les pollutions : axe « pollutions » ;
\- la biodiversité et la protection des espaces naturels, agricoles et sylvicoles : axe « biodiversité ».
Cette cotation peut être favorable (+1), neutre (0) ou défavorable (-1). 
Les conventions méthodologiques retenues sont détaillées dans le rapport (pages 11 à 14) :
<https://www.budget.gouv.fr/documentation/file-download/6796>

This joint maintenance schedule allows gas shippers to view in one place the restrictions applied by the various operators on the entry and exit points of the TRF (Trading Region France). 
It does not in any way replace the maintenance program published by each operator on its commercial portal, which alone are authentic and which contain additional information. The links to consult the maintenance programs of each operator are as follows: 
  * GRTgaz : <http://www.grtgaz.com/acces-direct/clients/fournisseur-trader/travaux.html>
  * Teréga : <https://portail.terega.fr/star-app/logistique/maintenances-et-reductions>
  * Storengy : <https://www.mystorengy.fr/s/?language=fr>
  * Elengy : <https://www.elengy.com/fr/clients/gestion-operationnelle/programme-des-travaux.html>
  * Fosmax LNG : <https://www.fosmax-lng.com/fr/nos-services/donnees-operationnelles/programme-de-maintenance.html>
  * Dunkerque LNG : <https://www.ebb.dlng-sico.com/MaintenanceEvent/Index>
For each "point of interest" (PIR, PITS, PITTM), the following restriction rates are automatically displayed: 
  * Those from the transport operator (GRTgaz or Teréga), applied at the point as well as at the superpoints concerned; 
  * Those from the adjacent operator, storage or LNG terminals. 
**Point of attention :** _these restriction rates apply to different type of capacities according to the concerned operators. Please see the "definitions" tab for exact definitions of restriction rates._
 ** _All information_** _presented by GRTgaz within the framework of the "Joint Work Programme of French gas operators » on the ODRÉ platform **is** ******provided** for information purposes **only**. GRTgaz does not guarantee their accuracy, completeness nor timeliness. Therefore, the user acknowledges that he or she uses this information under his or her sole liability._ _  
_
### **Definitions of the metadata**  
The restriction rate corresponds to the capacity unavailability rate for a given day. It applies to different types of capacities depending on the operators : 
  * **GRTgaz** : subscribed capacities ; 
  * **Teréga transport :** Commercial capacities ; 
  * **Teréga stockage :** technical capacities ; 
  * **Storengy :** capacity corresponding to the rights of the shipper for this day ; 
  * **Elengy and Fosmax LNG :** yearly technical capacity of regasification of the terminal / 365 ; 
  * **Dunkerque LNG :** daily technical capacity of regasification of the terminal. 
The 3 following types of rates are displayed : 
  * **Probable restriction rate :** firm capacity restriction rate giving the probable value of the restriction; 
  * **Maximum restriction rate :** firm capacity restriction rate giving the maximum value of the restriction; 
  * **Interruptible restriction rate :** interruptible capacity restriction rate (applies only to transport operators)

**La déclaration auprès de l'ADEME**
L’arrêté du 20 décembre 2007 relatif à la déclaration annuelle des organismes agréés, des distributeurs de fluides frigorigènes et des producteurs de fluides frigorigènes et d'équipements contenant des fluides frigorigènes définit, pour chaque acteur (distributeurs, producteurs et organismes agréés), la nature et les modalités des déclarations à effectuer auprès de l’Agence De l’Environnement et de la Maîtrise de l’Énergie (ADEME).
Des évolutions ont été apportées aux articles 543-75 à R. 543-123 du Code de l’environnement via le décret n°2011-396 du 13 avril 2011 relatif à des substances appauvrissant la couche d'ozone et à certains gaz à effet de serre fluorés, aux biocides et au contrôle des produits chimiques. <b>Ce décret modifie le périmètre de la filière gaz fluorés suivie par l’ADEME : outre les fluides frigorigènes, les gaz fluorés utilisés dans les secteurs Protection incendie, Haute-tension et Solvants seront désormais analysés.</b>
L'Observatoire des gaz fluorés est géré dans la base SYDEREP, permettant aux professionnels la saisie directe de leurs données. Le but étant de contrôler les quantités de mise sur le marché, d'utilisation, de récupération et de destruction des différents types de gaz. À partir de l’analyse de ces données, l’ADEME publie un rapport annuel permettant le suivi de la filière des gaz fluorés en France.<p></p>
**Le jeu de données présenté**
Le jeu de données présenté permet de vérifier la validité  :
<p></p><ul><li>d'un opérateur attesté de fluides frigorigènes, titulaire d'une attestation de capacité dans le secteur froid et climatisation
</li><li>d'une entreprise certifiée titulaire d'un certificat dans le secteur Protection incendie
</li></ul>
Les opérateurs sont les entreprises et organismes procédant, à titre professionnel, à tout ou partie des opérations suivantes sur des équipements contenant des fluides frigorigènes :
<ul><li>La mise en service ;
</li><li>L’entretien et la réparation, dès lors que ces opérations nécessitent une intervention sur le circuit contenant des fluides frigorigènes ;
</li><li>Le contrôle de l’étanchéité ;
</li><li>Le démantèlement ;
</li><li>La récupération et la charge des fluides frigorigènes ;
</li><li>Toute autre opération réalisée nécessitant la manipulation de fluides frigorigènes.</li></ul>
<p></p>
Les opérateurs doivent obtenir une attestation de capacité délivrée par un organisme agréé afin de pouvoir manipuler des fluides frigorigènes et ont l’obligation de remettre aux distributeurs les fluides récupérés qui ne peuvent être réintroduits dans des équipements (ou dont la réutilisation est interdite), ainsi que les emballages ayant contenu des fluides frigorigènes.
Ils ont également la possibilité de faire traiter les fluides usagés et les emballages sous leur responsabilité.
Les organismes agréés sont les organismes ayant reçu un agrément des ministres en charge de l’environnement et de l’industrie pour pouvoir délivrer des attestations de capacité aux opérateurs et certifier les entreprises du domaine de la protection incendie.
Les modalités de délivrance de l’attestation de capacité aux opérateurs sont définies par l’arrêté du 30 juin 2008 relatif à la délivrance des attestations de capacité aux opérateurs prévue à l’article R. 543-99 du Code de l’Environnement.<p></p>
Catégories d'activité :
<ul><li>Catégorie I (inclut les catégories II, III, IV et V) : Contrôle d’étanchéité, maintenance et entretien, mise en service, récupération des fluides des équipements de tous les équipements de réfrigération, de climatisation et de pompe à chaleur ;
</li><li>Catégorie II (inclut les catégories V) : Maintenance et entretien, mise en service, récupération des fluides des équipements de réfrigération, de climatisation et de pompe à chaleur contenant moins de 2 kg de fluides frigorigènes et contrôle d’étanchéité des équipements de réfrigération, de climatisation et de pompe à chaleur ;
</li><li>Catégorie III : Récupération des fluides des équipements de réfrigération, de climatisation et de pompe à chaleur de moins de 2 kg de fluides frigorigènes ;
</li><li>Catégorie IV : Contrôle d’étanchéité des équipements de réfrigération, de climatisation et de pompe à chaleur ;
</li><li>Catégorie V - toutes opérations : Contrôle d’étanchéité, maintenance et entretien, mise en service, récupération des fluides des systèmes de climatisation de véhicules, engins et matériels mentionnés à l’article R.311-1 du Code de la route ;
</li><li>Catégorie V - VHU : Catégorie V exclusivement pour les opérations de récupération des fluides des systèmes de climatisation des véhicules hors d’usage.</li></ul>
<p></p>
**Règles d'actualisation des données**
La liste n'est pas à jour en temps réel, elle est actualisée tous les quinze jours par les Organismes agréés par import dans SYDEREP. En cas de doute sur la validité d'une société, l'information doit être vérifiée auprès des organismes agréés.
<p>
Pour toute demande d’opérateur attesté ne figurant pas dans ce jeu de données ou sur SYDEREP, il convient de contacter l’Organisme agréé auquel l’opérateur est rattaché puisque c’est lui qui fait la mise à jour bimensuelle dans SYDEREP. </p>

Indice de qualité de l'air sur les agglomérations de Blois, Bourges, Chartres, Châteauroux, Dreux, Montargis, Orléans et Tours mesurés sur un an glissant sur constat. Indices sur prévision pour le jour même/le lendemain/le sur-lendemain.
_Généalogie :_ L'indice de qualité de l'air est un indicateur chiffré qui permet de donner une évaluation de la qualité de l'air sur une échelle de 1 à 10\. 
Il existe deux indices de qualité d'air quotidiens, différents selon la taille de l'agglomération : 
\- L’indice ATMO obligatoirement calculé dans les agglomérations de plus de 100 000 habitants ;
\- L’indice de qualité de l’air « simplifié » (IQA) calculé dans des agglomérations ou des zones géographiques de moins de 100 000 habitants. 
Ces indices sont calculés conformément aux dispositions de [l'article 3 de l'arrêté du 22 juillet 2004](https://www.legifrance.gouv.fr/affichTexte.do?cidTexte=JORFTEXT000000625624&categorieLien=id) modifié par [l'arrêté du 21 décembre 2011](https://www.legifrance.gouv.fr/affichTexte.do?cidTexte=JORFTEXT000025059976&dateTexte=&categorieLien=id). Ils sont déterminés à partir des niveaux de pollution mesurés au cours de la journée par les stations de fond chargées de surveiller la pollution générale de l'agglomération. Ils ne prennent pas en compte les stations de mesure directement liées au trafic. Ils intègrent les principaux polluants atmosphériques, traceurs des activités urbaines (transport, tertiaire etc.), domestiques et industrielles : 
  * le dioxyde d'azote (NO2) ; 
  * le dioxyde de soufre (SO2) ; 
  * les particules (PM10) ;
  * l'ozone (O3).
